    display: inline-block;
    border-radius: 0.4rem;
    border: solid 2px;
    color: $theme-orange;
    font-size: 1rem;
    transition: all 0.3s;
    position: relative;

    overflow: hidden;
    text-align: center;
    z-index: 1;

    &:after {
      content: '';
      position: absolute;
      bottom: 0;
      left: 0;
      width: 100%;
      height: 100%;
      background-color: $color;
      border-radius: 0.4rem;
      z-index: -2;
    }
    &:before {
      content: '';
      position: absolute;
      bottom: 0;
      left: 0;
      width: 0%;
      height: 100%;
      background-color: $theme-orange;
      transition: all 0.3s;
      border-radius: 0.2rem;
      z-index: -1;
    }
    &:hover {
      color: white;
      background-color: $theme-orange;
      &:before {
        width: 100%;
        cursor: pointer;
      }
    }
  }
